import './projects.css';








function projects() {
    return(
        <>
        <div className="profile container  rounded-md max-w-screen-md bg-slate-400 shadow-md" >
            <div className="block rounded-md max-w-md bg-slate-400 shadow-md" >
                <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages.unsplash.com%2Fphoto-1572177812156-58036aae439c%3Fixlib%3Drb-4.0.3%26ixid%3DM3wxMjA3fDB8MHxzZWFyY2h8NXx8cHJvamVjdHxlbnwwfHwwfHx8MA%253D%253D%26w%3D1000%26q%3D80&tbnid=sBAF37plM_w9VM&vet=12ahUKEwiRmIr69aKAAxU_5TgGHVcoCw4QMygEegUIARDBAQ..i&imgrefurl=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fproject&docid=H5DVv0UfboPgsM&w=1000&h=667&q=project%20img&ved=2ahUKEwiRmIr69aKAAxU_5TgGHVcoCw4QMygEegUIARDBAQ"></img>
                <h3 className='text-center italic'></h3>
            </div>

        </div>
        </>

    );
}

export default projects;
